import Foundation

struct User: Codable {
    let id: Int64
    let accessToken: String
    let accessTokenExpire: Int64
    let refreshToken: String
    let refreshTokenExpire: Int64
    
    enum CodingKeys: String, CodingKey {
        case id
        case accessToken = "access_token"
        case accessTokenExpire = "access_token_expire"
        case refreshToken = "refresh_token"
        case refreshTokenExpire = "refresh_token_expire"
    }
    
    func getTokensInfo() -> TokensInfo {
        return TokensInfo(accessToken: accessToken,
                          accessTokenExpire: accessTokenExpire,
                          refreshToken: refreshToken,
                          refreshTokenExpire: refreshTokenExpire)
    }
}


struct AutorizedUser {
    var email = ""
    var phone = ""
    var name = ""
    var telegrammNik = ""
    var myBrand: UsersBrand = UsersBrand()
    var yourselfinfo: AboutUserInfo = AboutUserInfo()
}

struct UsersBrand {
    var name = ""
    var tgName = ""
    var shopLink = ""
}

struct AboutUserInfo {
    var theme: String = ""
    var gender: String = ""
    var age: String = ""
    var incomeLevel: String = ""
    var geographic: String = ""
    var interests: String = ""
}

// MARK: - CreateBrand
struct CreateBrand: Codable {
    var id: Int
    var user: User2
    var subscription: Subscription
    var category, presenceType, publicSpeaker, subsCount: AvgBill
    var avgBill: AvgBill
    var goals, formats, collaborationInterest: [AvgBill]
    var subExpire, tgNickname, phone, brandNamePos: String
    var instBrandURL, brandSiteURL, topics, missionStatement: String
    var targetAudience, uniqueProductIs, productDescription, problemSolving: String
    var businessGroup, logo, photo, productPhoto: String
    var fullname, email: String

    enum CodingKeys: String, CodingKey {
        case id, user, subscription, category
        case presenceType = "presence_type"
        case publicSpeaker = "public_speaker"
        case subsCount = "subs_count"
        case avgBill = "avg_bill"
        case goals, formats
        case collaborationInterest = "collaboration_interest"
        case subExpire = "sub_expire"
        case tgNickname = "tg_nickname"
        case phone
        case brandNamePos = "brand_name_pos"
        case instBrandURL = "inst_brand_url"
        case brandSiteURL = "brand_site_url"
        case topics
        case missionStatement = "mission_statement"
        case targetAudience = "target_audience"
        case uniqueProductIs = "unique_product_is"
        case productDescription = "product_description"
        case problemSolving = "problem_solving"
        case businessGroup = "business_group"
        case logo, photo
        case productPhoto = "product_photo"
        case fullname, email
    }
}

// MARK: - AvgBill
struct AvgBill: Codable {
    var text: String
}

// MARK: - Subscription
struct Subscription: Codable {
    var id: Int
    var name: String
    var cost: Int
    var duration: String
}

// MARK: - User
struct User2: Codable {
    var id: Int
    var email, phone: String
}

